import "./App.css";
import Navbar from "./Navbar";
import Home from "./Home";
import About from "./About";
import Contact from "./Contact";
import Legend from "./Legends";
import History1 from "./History1";
import Helicopter from "./Helicopter";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function App() {
  
  return (
    <Router>
      <div className="App">
        <Navbar />
        <div className="content">
          <Switch>
            <Route exact path="/AirPlanes/" component={Home} />
            <Route exact path="/AirPlanes/about" component={About} />
            <Route exact path="/AirPlanes/contact" component={Contact} />
            <Route exact path="/AirPlanes/about" component={About} />
            <Route exact path="/AirPlanes/legend" component={Legend} />
            <Route exact path="/AirPlanes/history" component={History1} />
            <Route exact path="/AirPlanes/helicopter" component={Helicopter} />

          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
